#blog {
  margin-bottom: 5em;
}


#blog-post .hero-image {
  margin-top: 35px;
  background-image: url("../img/katherine.png");
  min-height: 30vh;
  background-attachment: fixed;
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  position: sticky;
  top:0;
  z-index: 2;
}

#blog-post .blog-post__header {
  padding: 75px;
  margin-top: 75px;
  display: grid;
  grid-template: auto 1fr auto;
  margin-right: auto;
  margin-left:auto;
  .post__nav{
      grid-column: 1 / 2;
      a     {
        position: relative;
        margin-right:auto;
        @include hover-line-revers;
            &::after {
            content:url(../img/Vector.svg);
            margin-left:10px;
            top:10px;
            border-bottom:0;
            position: absolute;
            }
      } 
    }

    .post__header {
      grid-column: 2 / 3;
      font-family: $sans;
      .post__tags{
        .tag {
          background: #F2E2D7;
          border-radius: 2px;
          padding: 2px 5px;
          font-family: $sans;
          color: var(--clr-umber-300);
        }
      }
      h2 {
        @include font-size($h1-font-sizes);
        margin-top: 30px;
      }
      .post__date {
        margin-bottom: 30px;
        color: var(--clr-green-300);
        font-family: $sans;
      }
    }
    section {
      padding: 0 48px;
      p {
        margin-bottom: 25px;
      }
  }
    .post__aside {
      grid-column: 3 / 4;
      height: 150px;
      width: 200px;
      background: var(--clr-umber-200);
      border-radius: 10px;
      padding: 25px;
      h5 {
        font-family: $sans;
        margin-bottom: 15px;
      }
      ul {
        @include flexCenter(column);
        align-items: flex-start;
        color: var(--clr-green-400);
        li {
          line-height: 1.5;
        }
      }

    }
  }

  .post__subheading {
    font-family: $sans;
    @include font-size($h3-font-sizes);
    margin: 20px 0 10px 0;
  }

.post__body {
  display: grid;
  grid-gap: 48px;
  grid-template: auto 1fr auto;
  @include font-size($p-header-font-sizes);
  max-width: 706px;
}
